import React from 'react';
import {Box, Heading, ModalOverlay, Textarea, VStack} from "@chakra-ui/react";

const NewQuestionDialog = ({visible, setVisible}) => {
    return (
        <>
            <Box
                onClick={() => setVisible(false)}
                zIndex={1000}
                bg={'gray.100'}
                opacity={.5}
                position={'fixed'}
                right={0}
                top={0}
                minW={'100vw'}
                minH={'100vh'}/>
            <Box zIndex={1001}
                 position={'fixed'}
                 right={'50%'}
                 top={'20%'}
                 bg={'orange.300'}
                 transform={"translate(50%,-50%)"}
            >
                <VStack minW={800} p={5}>
                    <Heading>Add questionss</Heading>
                    <Box w={'100%'}>
                        <Textarea placeholder="Here is a sample placeholder"/>
                    </Box>
                </VStack>
            </Box>
        </>
    );
};

export default NewQuestionDialog;
